A story about a romantic journey of a culturally 
opposite couple - Krish Malhotra and Ananya.     
They meet at the IIM-Ahmedabad College and       
during the program they fall in love.            
Complications arise after the program comes to   
an end and they decide to get married.           
They take a conscious decision; they won't       
get married until their parents agree. Everything
goes downhill when the parents meet.             
There is a cultural clash and the parents        
oppose the wedding. To convert their love        
marriage, the couple faces a tough battle        
in front of them.                                


